import React from "react";
import Envelople from "../../Assets/envelope.png";
import Logo from "../../Assets/logo.png";
import "./Footer.css";
const Footer = () => {
  const downloadButton = () => {
    return window.open(
      "https://drive.google.com/uc?export=download&id=1mVp-L8Gx3vyOY3phIgxNYKq4aXYI_vIY"
    );
  };
  return (
    <div className="footerContainer">
      <div className="footerRightSide">
        <h2 id="h2Text">Stay Updated About New Features And News.</h2>
        <h1 id="h1Text">Start Tracking Your Health Today</h1>
        <div className="inputContainer">
          <div class="form-control">
            <input type="value" required=""></input>
            <label>
              <span style="transition-delay:0ms">U</span>
              <span style="transition-delay:50ms">s</span>
              <span style="transition-delay:100ms">e</span>
              <span style="transition-delay:150ms">r</span>
              <span style="transition-delay:200ms">n</span>
              <span style="transition-delay:250ms">a</span>
              <span style="transition-delay:300ms">m</span>
              <span style="transition-delay:350ms">e</span>
            </label>
          </div>
          <button
            id="signUpBtn"
            onClick={() => alert("Just a dummy, no mail spamming here.")}
          >
            Sign up
          </button>
        </div>
        <div className="logoContainer">
          <h1 className="logoText">
            M<img className="footerLogo" src={Logo}></img>ing
          </h1>
          <h4 className="logoSubText">
            Take Care Of Your Body. It's The Only Place You Have To Live.
          </h4>
        </div>
      </div>
    </div>
  );
};
export default Footer;
